import React from 'react';

function SolarSystemComponent() {
  return (
    <div className="solar-system">
      <div className="sun"></div>
      <div className="orbit" style={{ '--orbitSize': '100px' }}>
        <div className="planet" style={{ '--planetIcon': 'url(../images/js.png)' }}></div>
      </div>
      {/* Repeat the above div for more planets with different --orbitSize and --planetIcon */}
    </div>
  );
}

export default SolarSystemComponent;
